import "./App.css";
import Navbar from "./navbar.js";

function Quiz() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body className="mBody">
        <h1>Fan Quiz</h1>
        <h3>
          Download and print this 4-page guide so you can have it handy when you
          play!
        </h3>
        <button className="hollowButton">DOWNLOAD PRINTABLE GUIDE</button>
      </body>
    </div>
  );
}

export default Quiz;
